राष्ट्रिय स्वतन्त्र पार्टी (रास्वपा)ले केन्द्रीय समिति बैठक बोलाएको छ ।&amp;nbsp;

आगामी फागुन २१ गतेलाई तोकिएको प्रतिनिधिसभा सदस्य निर्वाचनको रणनीति तय गर्नका लागि भोलि मंगलबार बिहान केन्द्रीय समितिको बैठक बोलाइएको प्रवक्ता मनिष झाले जानकारी दिए ।&amp;nbsp;

परिवर्तित अवस्थामा केन्द्रीय सदस्यहरूको धारणा बुझ्न र निर्वाचन रणनीतिबारे छलफल गर्न पार्टीका कार्यवाहक सभापति डोलप्रसाद अर्यालले बैठक बोलाएको उनले बताए ।&amp;nbsp;

